Batik Harmonisasi Etnik

BATIK sasambo mencerminkan keberagaman dan harmonisasi etnik di #NusaTenggaraBarat. Keragaman motif, corak, dan pewarnaannya mewakili #khazanah budaya #etnik asli setempat.

Sasambo ialah akronomin dari Sasak, Samawa, dan Mbojo. #Sasak merupakan #suku asli di #Lombok, dan #Samawa di #Sumbawa. Adapun #Mbojo merupakan suku asli di #Bima.

#Motif pada #batiksasamo, di antaranya made sahe atau mata sapi, kakando, kangkung, mutiara dan #UmaLengge atau #rumahtradisional setempat. Corak dan warna pada motif tersebut berbeda-beda pada setiap daerah.

Proses pembatikannya serupa dengan pembuatan #batik tulis di daerah lain. Selain dilukis dengan malam atau lilin, motif pada batik sasambo ada pula yang dicap atau kombinasi keduanya.

#Pembatik menggunakan potongan besi untuk melepaskan lapisan lilin pada bidang gambar atau motif saat proses #pewarnaankain. Ujung besinya dipanaskan dan ditempelkan pada bagian tersebut hingga lapisan lilin terlepas.¬†(PeladangKata.com)

