Repost @zimydakid

SHARKS,

they are on top of the food chain and have been ruling the oceans since the dinosaur era.

Our oceans ecosystem couldn't survive without these apex predators.

Yet, us, humans, we've been able to push them to extinction in just a few decades.

According to studies, we've lost as much as 90% of them and, if nothing is done, some species such as the hammerheads will completely disappear within 10 to 20 years...

This why I decided to create the movie that will give them the voice they need to fight this war !

The goals of the movie are to raise awareness by showing people that they aren't agressive man-eating creatures, to educate people by showing them what's happening and how our daily choices impact shark populations worldwide and, finally, show real solutions on how we could change things as a community but as an individual person as well in order to save them before it's too late...

This movie is a non-profit and is fully funded by myself at the moment.

The only goal is to preserve sharks as well as the health of the world's oceans and this is the reason why I need your help right now in order to make it happen.

I created a crowdfunding campaign that will help make it happen by allowing me to film these sharks and meet the people that are working day in and day out to preserve these amazing creatures.

If you want to help and take part in this project, click the link in my bio.

Please SHARE THIS VIDEO with your friends. By sharing this video, you'll also help more than you could ever think.

LET'S MAKE IT HAPPEN ALL TOGETHER AND SAVE THESE MAGNIFICENT CREATURES BEFORE THE CLOCK STOPS !

